import math

def is_prime(n):
    if n < 2:
        return False
    for i in range(2, int(math.sqrt(n))+1):
        if n % i == 0:
            return False
    return True

def lps(n):
    for i in range(int(math.sqrt(n)), 1, -1):
        if is_prime(i):
            return i
    return None

def ups(n):
    i = int(math.sqrt(n))
    while not is_prime(i):
        i += 1
    return i

