Using the given formula, the task is to find the summation of C(F_i) for i ranging from 2 to 90. The value of C(n) can be calculated using dynamic programming. Here is the code for the same:

```
def is_valid(row1, col1, row2, col2):
    '''
    Checks if two centaurs attack each other directly
    '''
    return row1 != row2 and col1 != col2 and abs(row1 - row2) != abs(col1 - col2)

def count_centaurs(n):
    '''
    Returns the number of ways to place n^2 centaurs on a n x n board so that no centaur attacks another directly
    '''
    # matrix to store the number of valid configurations
    dp = [[0 for i in range(1 << n)] for j in range(n * n + 1)]

    for i in range(n):
        for j in range(1 << n):
            # check if the current configuration is valid
            if j & (j << 1) == 0 and j & (j >> 1) == 0:
                dp[i + 1][j] = 1

    for i in range(2, n + 1):
        for j in range(1 << n):
            for k in range(1 << n):
                if dp[i - 1][k] == 0:
                    continue

                is_valid_config = True

                for l in range(n):
                    if k & (1 << l) == 0:
                        continue
                    for m in range(n):
                        if j & (1 << m) == 0:
                            continue
                        if not is_valid(i - 1, l, i, m):
                            is_valid_config = False
                            break

                    if not is_valid_config:
                        break
                if is_valid_config:
                    dp[i][j] += dp[i - 1][k]

    return dp[n][(1 << n) - 1]

# calculate the required summation
MOD = 10**8 + 7
a, b = 1, 1
ans = 0
for i in range(2, 91):
    c = a + b
    ans = (ans + count_centaurs(c) % MOD) % MOD
    a, b = b, c

print(ans)
```
